import { makeStyles } from '@material-ui/core/styles'

export default makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        margin: theme.spacing(1),
    },
    userName:{
        width: '121px',
        height: '19px',
        left: '23px',
        top: '228px',

        fontFamily: 'Inter',
        fontStyle: 'normal',
        fontWeight:'600',
        fontSize: '16px',
        lineHeight: '19px',
    },
    IconButton:{
        width:'48px'
    }
}))
